member.example:
This sample shows how to call HeadAsync.

AzureKeyCredential credential = new AzureKeyCredential("<key>");
AutorestSecurityKeyClient client = new AutorestSecurityKeyClient(credential);

Response response = await client.HeadAsync();

Console.WriteLine(response.Status);

This sample shows how to call HeadAsync with all request content.

AzureKeyCredential credential = new AzureKeyCredential("<key>");
AutorestSecurityKeyClient client = new AutorestSecurityKeyClient(credential);

Response response = await client.HeadAsync();

Console.WriteLine(response.Status);

